import React from 'react';

function CommonLogin(props) {    
    return (props.trigger) ? (
    <>
       <h4>Сіз кімсіз?</h4>
       
       <div className="card-group">
  
  <div className="card">
    <img src={"https://static.vecteezy.com/system/resources/previews/005/519/978/original/cartoon-drawing-of-a-teacher-vector.jpg"} className="card-img-top" alt="..."/>
    <div className="card-body">
      <h5 className="card-title">Мұғалім</h5>
    </div>
  </div>

  <div className="card">
    <img src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} className="card-img-top" alt="..."/>
    <div className="card-body">
      <h5 className="card-title">Студент</h5>
    </div>
  </div>

</div>
 
     <button className="close-btn">X</button>
     {props.children}
    </>
    ) : "";
  }
  
  export default CommonLogin;
